package bd.edu.seu.messmanagmentsystem.model;import lombok.AllArgsConstructor;import lombok.Data;import lombok.NoArgsConstructor;import javax.persistence.Column;import javax.persistence.Embeddable;import javax.persistence.Embedded;@Embeddable@Data@AllArgsConstructor@NoArgsConstructorpublic class Address {    @Column(name = "Village",length = 50)    private String village;    @Column(name = "Upazila",length = 50)    private String upazila;    @Column(name = "District",length = 50)    private String District;    @Column(name = "Division",length = 50)    private String Division;    @Column(name = "Country",length = 50)    private String Country;}